import './index.css'
import { useContext } from "react";
import { UserContext } from "../../../Contexts/UserContext";

export default function TweetBtn() {
  const data = useContext(UserContext);
  return (
    <div>
      {data ? (
      <a href="/new" className="tweetLink">
      <div className="tweetBtn">
        <p>Tweet</p>
      </div>
    </a>
      ) : null}
    </div>
  )
}
